INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3381, 1, N'This agent determines which offers, product groups or customer groups need to be sent to which locations.  Once determined, CM Offer Agent calls the ExportXML.dll method to generate the files.  Once completed, it adds entries into the database OfferDLBuffer table to indicate which files need to go to which locations.  This agent interacts with file storage and the RT and XS databases, and references the AgentInc, CommonInc and ExportXML libraries.', CAST(0x00009AD500E3F184 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3382, 1, N'The ProcessProductGroups agent scans the ProdInsertQueue table in the LogixRT database for entries of files that have been uploaded from the UI.  Files found are bulk inserted into the database using the configured format files located in the configured bulk insert path.  This agent interacts with file storage and the RT database, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E4A728 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3383, 1, N'The ProcessCustomerGroups agent scans the GMInsertQueue table in the LogixXS database for files that have been uploaded from the UI.  These files are bulk inserted into the database using the configured format files located in the configured bulk insert path.  This agent interacts with file storage and the RT and XS databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E4BE98 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3384, 1, N'The TCRMAgent receives offer information that has been created in Teradata (TRM/OTM applications) and auto-populates the offers into Logix.  The offer data includes customers, products, general offer details and locations.  The agent also takes offers setup in the Logix UI and sends them through the transfer tables to Teradata.  This operation leverages a Teradata OLEDB  driver to expose tables to the SQL server as views.  These views from Teradata are used to transfer the data between the Logix central host and Teradata.
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3385, 1, N'The ProductHierarchyAgent looks for update XML files on a configured file storage space and updates/creates entries in the product hierarchy in the database.  This agent interacts with file storage and the RT database, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E51B2C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3386, 1, N'The Customer Update Agent Looks for update XML files in a configured storage space and updates/creates customer records in the database.  This agent interacts with the RT and XS databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E541D8 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3387, 1, N'The Location Hierarchy Agent looks for update XML files on a configured file storage space and updates/creates entries in the location hierarchy in the database.  This agent interacts with file storage and the RT database, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E5AA24 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3388, 1, N'The Offer File Agent scans OfferDLBuffer table and creates a location XML file based on entries in the buffer table.  It writes this file to the configured storage space.  This agent interacts with file storage and the RT database, and references the AgentInc, CommonInc and ExportXML libraries.', CAST(0x00009AD500E5BF3C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3389, 1, N'The ProductUpdateAgent looks for update XML files in the configured storage space and updates/creates product records in the database.  This agent interacts with file storage and the RT database, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E5E264 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3390, 1, N'The Location Update Agent looks for update XML files in a configured storage space and updates/creates location records in the database.  This agent interacts with file storage and the RT database, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E5FD58 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3391, 1, N'The PromoVarAgent looks for promotion variables associated with offers (e.g., DistPeriodVarID in the Offers table of the LogixRT database) and resets them on a periodic basis as needed, based on the distribution limits of the offer.  This agent interacts with the RT and XS databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E61144 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3392, 1, N'Watch Dog monitors all the other agents running on the Central Server and notes those that haven''t run in a certain amount of time.', CAST(0x00009AD500E621AC AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3393, 1, N'The DB Purge Agent deletes the offers marked for deletion by the dailyDelete process.  This agent interacts with the RT and XS databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E6346C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3394, 1, N'The ReportingAgent collects impression, redemption and savings data for offers in which reporting is turned on and makes it available to Logix users.  It moves data waiting in the ImpressionBuffer and the TransHistory table to the OfferReporting table.  This agent interacts with the RT and WH databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009AD500E64AB0 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3395, 1, N'The Promo Movement Agent imports transaction history and offer impression information uploaded by the local servers.  This agent interacts with file storage and the RT and WH databases, and references the AgentInc and CommonInc libraries.', CAST(0x00009B60009E4A44 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3396, 1, N'The CPEOfferAgent checks databases on a recurring basis for offer changes.  When changes are found, it prepares data files containing the new offer information for download by the local servers.  CPE Offer Agent also maintains a queue of the files that need to be downloaded by each local server.', CAST(0x00009AD500E836E0 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3397, 1, N'TransUpdateAgents look for data relevant to transactional shopping activity (earned points, accumulation amounts, etc.) that were uploaded from local servers into temp tables in the cross-shopping (XS) database.  TransUpdateAgents move these data from the temp tables to where they need to be, e.g. for duplication in XS from where other stores may download that data, and also for permanent relocation into the RT and WH databases.<br />
