INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (3408, 1, N'When the stored value data export option is enabled in Logix, the Data Export Agent exports stored value records to a file in a user-configurable server path, optionally in GZIP format.  The agent can be configured to produce the files at specified times and on specified days, via Data Export options in the UI.', CAST(0x0000A00500A8EA30 AS DateTime) ); 
