INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4035, 1, N'The AltID connector allows users to manage customers'' alternate IDs. It has BannerList, CreateUpdate and Request operations.', CAST(0x00009C3A00B182F8 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4036, 1, N'Performs the functions of the customer inquiry section of Logix, particularly viewing and adjusting points balances.', CAST(0x00009C3A00A71B4C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4037, 1, N'Performs the functions of the customer-facing website – displaying customer details, listing offers that customers are eligible to receive, and opting customers into or out of customer groups.', CAST(0x00009C3A00A72380 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4040, 1, N'The CMConnector includes methods used for data exchange between the store system and Logix.  CMConnector.asmx provides the following methods to the store systems: GetStatus, GetAccount and PutTransaction.', CAST(0x00009C3A00A268F4 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4041, 1, N'The External Offer Connector (EOC) web service enables clients to add, update, and retrieve offer information in a manner similar to maintaining offers in the Logix user-interface.  The EOC is especially useful to allow third party entities (known in Logix as external sources) to run offers in a client''s enterprise.  It allows partners to create and maintain their offers while the client still retains offer approval and modification rights.', CAST(0x0000A00500AB192C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4042, 1, N'The CM RemoteData connector is the measn through which stores communicate issuance data to the central server.  The connector receives the transactional reward information from the local server and writes the file to shared storage', CAST(0x0000A00500AE0D08 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4050, 1, N'The CPE RemoteData connector is the mean through which stores communicate issuance data to the central server.  The connector receives the transactional reward information from the local server and saves it for the ProcessIssuance agent to handle.', CAST(0x0000A00500AE33B4 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4051, 1, N'The external customer connector enables clients to create new customers within the Logix system and to retrieve customer information.', CAST(0x0000A00500AEFAEC AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4052, 1, N'The External Offer Connector (EOC) web service enables clients to add, update, and retrieve offer information in a manner similar to maintaining offers in the Logix user-interface.  The EOC is especially useful to allow third party entities (known in Logix as external sources) to run offers in a client''s enterprise.  It allows partners to create and maintain their offers while the client still retains offer approval and modification rights.', CAST(0x0000A00500AB2868 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4053, 1, N'This CGI process enables a local server to contact Logix to download the files prepared for it by IncentiveAgent. (IncentiveFetch on the local server actually contacts IncentiveFetch on Logix). Runs at configurable intervals.', CAST(0x00009C3A00A50168 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4054, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-CG manages customer group records.
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4055, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-Customer manages individual customer records.', CAST(0x00009C3A00A53624 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4056, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-Offers manages offer records.', CAST(0x00009C3A00A5468C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4057, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-PG manages product group records.', CAST(0x00009C3A00A55244 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4058, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-Points manages points records.', CAST(0x00009C3A00A56180 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4059, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-RA manages reward accumulation records.', CAST(0x00009C3A00A571E8 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4060, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-RD manages reward distribution records.', CAST(0x00009C3A00A5837C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4061, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-SV manages stored value records.', CAST(0x00009C3A00A58E08 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4062, 1, N'IPL connectors prepare various data records that are then provided to local servers during the IPL (Initial Program Load) process. IPL-UR manages user response records.', CAST(0x00009C3A00A5A0C8 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4063, 1, N'The LS Health connector receives health local server health information from the LS Health server and updates the health status of store servers within Logix.', CAST(0x0000A00500AF5528 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4064, 1, N'Validates the deployment of offer data in a way that allows the user to view the deployment health of a particular offer in Logix. Offer validation data is transmitted to central as part of the AutoIPL and IncentiveFetch processes on the local server.', CAST(0x00009C3A00A652E8 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4065, 1, N'If a HouseholdID does not exist in the local server database, PhoneHome prompts the central server to start InfoNow. InfoNow retrieves the profile stored for that HouseholdID and marks it as a known customer to that particular store.', CAST(0x00009C3A00A6773C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4066, 1, N'Collects impression, redemption, and savings data for offers and makes that data available to Logix users. Impression information is transmitted to the central server on a daily basis. Redemption and savings data is transmitted to the central server once per hour.', CAST(0x00009C3A00A69104 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4067, 1, N'Sanity Check queries various database tables and obtains a list of primary keys, then computes an MD5 checksum on the payload and posts the data to the central server. The result of the process is one of the following responses: ACK, NAK, InvalidSerial or MustIPL.', CAST(0x00009C3A00A6CB9C AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4068, 1, N'The Server List connector returns a list of local server information and their last LS Health RunID.', CAST(0x0000A00500B1B688 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4069, 1, N'Downloads transactional data records that have been moved to Logix by TransUpload. The data downloaded are accumulated from all other stores where the customer shops. Runs every 10 minutes.', CAST(0x00009C3A00A6F248 AS DateTime) ); 
INSERT INTO [dbo].[PhraseText] (PhraseID, LanguageID, Phrase, LastUpdate ) VALUES (4070, 1, N'Gathers all transactional data (points used, promotions accumulated, limits blown, etc.) that have occurred since the last time TransUpload ran. TransUpload sends this data to Logix so it can be organized and distributed to the other stores at which the customer shops.', CAST(0x00009C3A00A70D3C AS DateTime) ); 
